import React, {Component} from 'react';
import { Pie } from 'react-chartjs-2';

class Piechart extends Component {
    render() {
      const { data, options, height, totalValue } = this.props;
      return (
        <div>
          <Pie data={data} options={options} height={height} totalValue={totalValue} />
        </div>
    );
  }
}

export default Piechart;
